import React from "react";

const Wedding = () => {
  return (
   <section>
       <section>
           <p>And one of His signs is that He created mates for you from yourselves that you may find rest in them, and He put between you love and compassion; most surely there are signs in this for a people who reflect.

</p>
       </section>
   </section>
  );
};

export default Wedding;
